DROP TABLE IF EXISTS "public"."data_commodity_classification";
CREATE TABLE "public"."data_commodity_classification" (
  "id" varchar(32) COLLATE "pg_catalog"."default",
  "parent_id" varchar(32) COLLATE "pg_catalog"."default",
  "level" int2,
  "name" varchar(64) COLLATE "pg_catalog"."default",
  "merger_name" varchar(255) COLLATE "pg_catalog"."default"
)
;
COMMENT ON COLUMN "public"."data_commodity_classification"."level" IS '类别等级';
COMMENT ON COLUMN "public"."data_commodity_classification"."name" IS '商品分类';
COMMENT ON COLUMN "public"."data_commodity_classification"."merger_name" IS '商品类别组合名';
COMMENT ON TABLE "public"."data_commodity_classification" IS '3级商品分类数据表';

